import React, {use} from 'react'
import LowestLevel from './LowestLevel'

const MidLevel = (props) => {
    useEffect(() => {
        console.log('in the lowest level useEffect!');
    })
    return (
        <div>
            <LowestLevel res={props.res} setRes={props.setRes}/>
        </div>
    )
}

export default MidLevel
